export class WebhookService {
  constructor(
    private githubService: GitHubService,
    private geminiService?: GeminiService
  ) {}

  async handlePullRequestEvent(payload: GitHubWebhookPayload) {
    const { action, pull_request, repository, installation } = payload;

    // Only process opened and synchronize events for now
    if (!["opened", "synchronize"].includes(action)) {
      console.log(`Skipping PR event: ${action}`);
      return;
    }

// GitHub webhook payload types
export interface GitHubWebhookPayload {
  action: string;
  pull_request: {
    number: number;
    title: string;
    user: {
      login: string;
    };
  };
  repository: {
    owner: {
      login: string;
    };
    name: string;
  };
  installation?: {
    id: number;
  };
}

export interface PullRequestData {
  pr: {
    number: number;
    title: string;
    user: {
      login: string;
    };
  };
  diff: string;
  files: Array<{
    filename: string;
    status: string;
    additions: number;
    deletions: number;
    changes: number;
  }>;
}

export interface CodePatch {
  file: string;
  originalContent: string;
  patchedContent: string;
  description: string;
  type: 'fix' | 'refactor' | 'optimization' | 'security';
}

export interface AISuggestion {
  file: string;
  line?: number;
  issue: string;
  suggestion: string;
  reasoning: string;
  severity: 'error' | 'warning' | 'info';
  category: 'Security' | 'Performance' | 'Maintainability' | 'Style' | 'Bug' | 'Architecture';
  patch?: string;
}
